package class0324;

import java.util.Stack;

public class stack {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Stack<String> stack = new Stack<String>();
		stack.add("1. Ji");
		System.out.println(stack);
		stack.add("2. Lee");
		System.out.println(stack);
		System.out.println(stack.pop());
		System.out.println(stack);
	}

}
